export const fetchFavorites = function(){
  return function(dispatch){
    console.log('send request')
    return fetch('http://localhost:5000/api/get_rpi_info')
      .then(response => response.json())
      .then(response => {
        dispatch(receiveFavorites(response))
      })
      .catch(error => {
        console.log(error)
      })
  }
}
